INSERT INTO `games` (`id`, `name`, `cover_path`, `description`, `developer_name`, `publisher_name`, `releasedate`, `price`) VALUES
(6, 'Game1', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/6795408e5dcf6.jpeg', 'This is a description', 'Dev1', 'Pub1', '2013-06-12', 29.99),
(7, 'Game2', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67954098e4d19.jpeg', 'This is a description', 'Dev2', 'Pub2', '2012-06-20', 29.99),
(33, 'Game3', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/679540a0d788c.jpeg', 'Description for Game3', 'Dev3', 'Pub3', '2014-06-04', 29.99),
(34, 'Game4', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/679540a8c1191.jpeg', 'This is another description', 'Dev4', 'Pub4', '2011-06-15', 29.99),
(35, 'Game5', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/679540b04aa63.jpeg', 'This is another description', 'Dev5', 'Pub5', '2003-09-04', 29.99),
(36, 'Super Mario Bros.', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a7a3e707577.jpg', 'A side scrolling 2D platformer and first entry in the Super Mario franchise, Super Mario Bros. follows Italian plumber Mario as he treks across many levels of platforming challenges featuring hostile enemies to rescue Princess Peach from the evil king Bowser.', 'Nintendo', 'Nintendo', '1985-09-13', 19.99),
(37, 'Super Mario Galaxy', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a7a3c88aa94.jpg', 'A 3D platformer and first Wii entry in the Super Mario franchise, Super Mario Galaxy sees Mario jump across planets and galaxies with varying items, enemies, geographies and gravity mechanics in order to reach his enemy Bowser, who has attacked the Mushroom Kingdom and hijacked Princess Peach\'s castle with her inside.', 'Nintendo', 'Nintendo', '2007-11-01', 39.99),
(38, 'Super Mario Odyssey', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a7a3a66ce9f.png', 'Explore incredible places far from the Mushroom Kingdom as you join Mario and his new ally Cappy on a massive, globe-trotting 3D adventure. Use amazing new abilities, like the power to capture and control objects, animals, and enemies to collect Power Moons so you can power up the Odyssey airship and save Princess Peach from Bowser’s wedding plans!', 'Nintendo', 'Nintendo', '2017-10-27', 59.99),
(39, 'Just Dance 4', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a78a1cbd80f.png', 'Just Dance 4 features more than 40 new tracks, ranging from chart-topping Billboard hits to classic dance party tracks. Whether it\'s pop, Hip-Hop, rock, R&B, country or funk, there is something for everyone to dance to.', 'Ubisoft', 'Ubisoft', '2012-10-02', 39.99),
(40, 'Minecraft', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a78c0279cfb.jpeg', 'Explore randomly generated worlds and build amazing things from the simplest of homes to the grandest of castles in the creativity world of Minecraft. Play in creative mode with unlimited resources or mine deep into the world in survival mode, crafting weapons and armor to fend off the dangerous mobs.', '4JStudios, Mojang', 'Mojang', '2009-05-17', 29.99),
(41, 'Super Mario Galaxy 2', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a7a282b9419.jpg', 'Super Mario Galaxy 2 is the sequel to Super Mario Galaxy and the fourth 3D platformer entry in the Mario franchise. The sequel retains many elements from its predecessor, such as the adventure being in outer space, the element of gravity, and recurring objects such as Launch Stars and Sling Stars. Returning items include the Bee Mushroom and the Fire Flower. However, the game introduces new elements as well, such as the utilization of Yoshi, new power-ups like the Cloud Flower, and the use of a guide within the game for beginner players.', 'Nintendo', 'Nintendo', '2010-05-23', 39.99),
(42, 'Grand Theft Auto V', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a79bd299dc4.jpg', 'Trouble taps on your window again with this next chapter in the Grand Theft Auto universe, set in the city of Los Santos.', 'Rockstar Games', 'Rockstar Games', '2013-09-17', 29.99),
(43, 'Mario Kart Wii', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a7a1342411a.png', 'Mario Kart Wii is a multiplayer-oriented racing game for the Wii, and the sixth main installment in the Mario Kart series. Mario Kart Wii retains the traditional item-based weaponry familiar with the franchise, where players can select a Mario franchise driver and themed vehicles. As with most racing games, the overarching goal is to place first among other competitors, through the usage of such items and taking the fastest routes to secure the leads. Several new key elements introduced to Mario Kart Wii include increasing the number of racers to 12 racers from 8 racers from previous entries in the series, as well as introducing a new type of vehicle to the franchise: bikes. The game takes advantage of features unique to the Wii, most notably its motion control capabilities. A Wii Wheel is included in most Mario Kart Wii packages, though the game is still compatible with other controllers. Game modes are also present such as the traditional Grand Prix, Versus, Battle, and Time Trial modes.', 'Nintendo', 'Nintendo', '2008-04-10', 39.99),
(44, 'Mario Kart 8 Deluxe', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a7a102e2e35.jpg', 'Hit the road with the definitive version of Mario Kart 8 and play anytime, anywhere! Race your friends or battle them in a revised battle mode on new and returning battle courses. Play locally in up to 4-player multiplayer in 1080p while playing in TV Mode. Every track from the Wii U version, including DLC, makes a glorious return. Plus, the Inklings appear as all-new guest characters, along with returning favorites, such as King Boo, Dry Bones, and Bowser Jr.!', 'Nintendo', 'Nintendo', '2017-04-28', 59.99),
(45, 'Super Mario Bros. Wonder', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a9cef294152.jpg', 'The next evolution of 2D side-scrolling Super Mario Bros. games is headed to Nintendo Switch! When you touch a Wonder Flower in the game, the wonders of the world unlock – pipes could come alive, hordes of enemies may appear, characters might change their looks, for example – transforming the gameplay in unpredictable ways. Excitement and different surprises await in each course. Super Mario Bros. Wonder features Princess Peach, Princess Daisy and Yoshi as playable characters, in addition to familiar characters like Mario, Luigi and Toad.', 'Nintendo', 'Nintendo', '2023-10-20', 59.99),
(46, 'Mario & Luigi: Brothership', 'http://localhost/ProjetoSI_HenriqueNeves/backend/web/uploads/games/67a9d0483db4e.jpg', 'The brothers return for a brand new adventure on the high seas! Set sail with Mario and Luigi on Shipshape Island (part ship, part island) and journey through the vast world of Concordia. Launch out of Shipshape’s cannon to visit, explore, and quest your way through islands that range from tropical rainforests to bustling cities. Meet new friends along the way, like Connie and Snoutlet (who\'s definitely not a pig), and encounter familiar faces from the Mushroom Kingdom like Peach and Bowser, who may help you on your journey! You’ll have to rely on Mario and Luigi’s brotherly bond to succeed. Use Bros. Moves to get past obstacles while you explore, and powerful Bros. Attacks in a dynamic twist on turn-based combat. You’ll need every edge this \'brothership\' will give you to save the day!', 'Acquire, Nintendo', 'Nintendo', '2024-11-07', 59.99);

